module.exports = [{"title":"O EU, O OUTRO E O NÓS","itens":[{"code":"EI01EO01","range":"Bebês (zero a 1 ano e 6 meses)","description":"Perceber que suas ações têm efeitos nas outras crianças e nos adultos."},{"code":"EI02EO01","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Demonstrar atitudes de cuidado e solidariedade na interação com crianças e adultos."},{"code":"EI03EO01","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Demonstrar empatia pelos outros, percebendo que as pessoas têm diferentes sentimentos, necessidades e maneiras de pensar e agir."},{"code":"EI01EO02","range":"Bebês (zero a 1 ano e 6 meses)","description":"Perceber as possibilidades e os limites de seu corpo nas brincadeiras e interações das quais participa."},{"code":"EI02EO02","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Demonstrar imagem positiva de si e confiança em sua capacidade para enfrentar dificuldades e desafios."},{"code":"EI03EO02","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Agir de maneira independente, com confiança em suas capacidades, reconhecendo suas conquistas e limitações."},{"code":"EI01EO03","range":"Bebês (zero a 1 ano e 6 meses)","description":"Interagir com crianças da mesma faixa etária e adultos ao explorar espaços, materiais, objetos, brinquedos."},{"code":"EI02EO03","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Compartilhar os objetos e os espaços com crianças da mesma faixa etária e adultos."},{"code":"EI03EO03","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Ampliar as relações interpessoais, desenvolvendo atitudes de participação e cooperação."},{"code":"EI01EO04","range":"Bebês (zero a 1 ano e 6 meses)","description":"Comunicar necessidades, desejos e emoções, utilizando gestos, balbucios, palavras."},{"code":"EI02EO04","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Comunicar-se com os colegas e os adultos, buscando compreendê-los e fazendo-se compreender."},{"code":"EI03EO04","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Comunicar suas ideias e sentimentos a pessoas e grupos diversos."},{"code":"EI01EO05","range":"Bebês (zero a 1 ano e 6 meses)","description":"Reconhecer seu corpo e expressar suas sensações em momentos de alimentação, higiene, brincadeira e descanso."},{"code":"EI02EO05","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Perceber que as pessoas têm características físicas diferentes, respeitando essas diferenças."},{"code":"EI03EO05","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Demonstrar valorização das características de seu corpo e respeitar as características dos outros (crianças e adultos) com os quais convive."},{"code":"EI01EO06","range":"Bebês (zero a 1 ano e 6 meses)","description":"Interagir com outras crianças da mesma faixa etária e adultos, adaptando-se ao convívio social."},{"code":"EI02EO06","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Respeitar regras básicas de convívio social nas interações e brincadeiras."},{"code":"EI03EO06","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Manifestar interesse e respeito por diferentes culturas e modos de vida."},{"code":"EI02EO07","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Resolver conflitos nas interações e brincadeiras, com a orientação de um adulto."},{"code":"EI03EO07","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Usar estratégias pautadas no respeito mútuo para lidar com conflitos nas interações com crianças e adultos"}]},{"title":"CORPO, GESTOS E MOVIMENTOS","itens":[{"code":"EI01CG01","range":"Bebês (zero a 1 ano e 6 meses)","description":"Movimentar as partes do corpo para exprimir corporalmente emoções, necessidades e desejos."},{"code":"EI02CG01","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Apropriar-se de gestos e movimentos de sua cultura no cuidado de si e nos jogos e brincadeiras."},{"code":"EI03CG01","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Criar com o corpo formas diversificadas de expressão de sentimentos, sensações e emoções, tanto nas situações do cotidiano quanto em brincadeiras, dança, teatro, música."},{"code":"EI01CG02","range":"Bebês (zero a 1 ano e 6 meses)","description":"Experimentar as possibilidades corporais nas brincadeiras e interações em ambientes acolhedores e desafiantes."},{"code":"EI02CG02","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Deslocar seu corpo no espaço, orientando-se por noções como em frente, atrás, no alto, embaixo, dentro, fora etc., ao se envolver em brincadeiras e atividades de diferentes naturezas."},{"code":"EI03CG02","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Demonstrar controle e adequação do uso de seu corpo em brincadeiras e jogos, escuta e reconto de histórias, atividades artísticas, entre outras possibilidades."},{"code":"EI01CG03","range":"Bebês (zero a 1 ano e 6 meses)","description":"Imitar gestos e movimentos de outras crianças, adultos e animais."},{"code":"EI02CG03","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Explorar formas de deslocamento no espaço pular, saltar, dançar), combinando movimentos e seguindo orientações."},{"code":"EI03CG03","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Criar movimentos, gestos, olhares e mímicas em brincadeiras, jogos e atividades artísticas como dança, teatro e música."},{"code":"EI01CG04","range":"Bebês (zero a 1 ano e 6 meses)","description":"Participar do cuidado do seu corpo e da promoção do seu bem-estar."},{"code":"EI02CG04","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Demonstrar progressiva independência no cuidado do seu corpo."},{"code":"EI03CG04","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Adotar hábitos de autocuidado relacionados a higiene, alimentação, conforto e aparência."},{"code":"EI01CG05","range":"Bebês (zero a 1 ano e 6 meses)","description":"Utilizar os movimentos de preensão, encaixe e lançamento, ampliando suas possibilidades de manuseio de diferentes materiais e objetos."},{"code":"EI02CG05","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Desenvolver progressivamente as habilidades manuais, adquirindo controle para desenhar, pintar, rasgar, folhear, entre outros."},{"code":"EI03CG05","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Coordenar suas habilidades manuais no atendimento adequado a seus interesses e necessidades em situações diversas"}]},{"title":"TRAÇOS, SONS, CORES E FORMAS","itens":[{"code":"EI01TS01","range":"Bebês (zero a 1 ano e 6 meses)","description":"Explorar sons produzidos com o próprio corpo e com objetos do ambiente."},{"code":"EI02TS01","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Criar sons com materiais, objetos e instrumentos musicais, para acompanhar diversos ritmos de música."},{"code":"EI03TS01","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Utilizar sons produzidos por materiais, objetos e instrumentos musicais durante brincadeiras de faz de conta, encenações, criações musicais, festas."},{"code":"EI01TS02","range":"Bebês (zero a 1 ano e 6 meses)","description":"Traçar marcas gráficas, em diferentes suportes, usando instrumentos riscantes e tintas."},{"code":"EI02TS02","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Utilizar materiais variados com possibilidades de manipulação argila, massa de modelar), explorando cores, texturas, superfícies, planos, formas e volumes ao criar objetos tridimensionais."},{"code":"EI03TS02","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Expressar-se livremente por meio de desenho, pintura, colagem, dobradura e escultura, criando produções bidimensionais e tridimensionais."},{"code":"EI01TS03","range":"Bebês (zero a 1 ano e 6 meses)","description":"Explorar diferentes fontes sonoras e materiais para acompanhar brincadeiras cantadas, canções, músicas e melodias."},{"code":"EI02TS03","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Utilizar diferentes fontes sonoras disponíveis no ambiente em brincadeiras cantadas, canções, músicas e melodias."},{"code":"EI03TS03","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Reconhecer as qualidades do som (intensidade, duração, altura e timbre), utilizando-as em suas produções sonoras e ao ouvir músicas e sons."}]},{"title":"ESCUTA, FALA, PENSAMENTO E IMAGINAÇÃO","itens":[{"code":"EI01EF01","range":"Bebês (zero a 1 ano e 6 meses)","description":"Reconhecer quando é chamado por seu nome e reconhecer os nomes de pessoas com quem convive."},{"code":"EI02EF01","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Dialogar com crianças e adultos, expressando seus desejos, necessidades, sentimentos e opiniões."},{"code":"EI03EF01","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Expressar ideias, desejos e sentimentos sobre suas vivências, por meio da linguagem oral e escrita escrita espontânea), de fotos, desenhos e outras formas de expressão."},{"code":"EI01EF02","range":"Bebês (zero a 1 ano e 6 meses)","description":"Demonstrar interesse ao ouvir a leitura de poemas e a apresentação de músicas."},{"code":"EI02EF02","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Identificar e criar diferentes sons e reconhecer rimas e aliterações em cantigas de roda e textos poéticos."},{"code":"EI03EF02","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Inventar brincadeiras cantadas, poemas e canções, criando rimas, aliterações e ritmos."},{"code":"EI01EF03","range":"Bebês (zero a 1 ano e 6 meses)","description":"Demonstrar interesse ao ouvir histórias lidas ou contadas, observando ilustrações e os movimentos de leitura do adulto-leitor (modo de segurar o portador e de virar as páginas)."},{"code":"EI02EF03","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Demonstrar interesse e atenção ao ouvir a leitura de histórias e outros textos, diferenciando escrita de ilustrações, e acompanhando, com orientação do adulto- leitor, a direção da leitura (de cima para baixo, da esquerda para a direita)."},{"code":"EI03EF03","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Escolher e folhear livros, procurando orientar-se por temas e ilustrações e tentando identificar palavras conhecidas."},{"code":"EI01EF04","range":"Bebês (zero a 1 ano e 6 meses)","description":"Reconhecer elementos das ilustrações de histórias, apontando-os, a pedido do adulto-leitor."},{"code":"EI02EF04","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Formular e responder perguntas sobre fatos da história narrada, identificando cenários, personagens e principais acontecimentos."},{"code":"EI03EF04","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Recontar histórias ouvidas e planejar coletivamente roteiros de vídeos e de encenações, definindo os contextos, os personagens, a estrutura da história."},{"code":"EI01EF05","range":"Bebês (zero a 1 ano e 6 meses)","description":"Imitar as variações de entonação e gestos realizados pelos adultos, ao ler histórias e ao cantar."},{"code":"EI02EF05","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Relatar experiências e fatos acontecidos, histórias ouvidas, filmes ou peças teatrais assistidos etc."},{"code":"EI03EF05","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Recontar histórias ouvidas para produção de reconto escrito, tendo o professor como escriba."},{"code":"EI01EF06","range":"Bebês (zero a 1 ano e 6 meses)","description":"Comunicar-se com outras pessoas usando movimentos, gestos, balbucios, fala e outras formas de expressão."},{"code":"EI02EF06","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Criar e contar histórias oralmente, com base em imagens ou temas sugeridos."},{"code":"EI03EF06","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Produzir suas próprias histórias orais e escritas escrita espontânea), em situações com função social significativa."},{"code":"EI01EF07","range":"Bebês (zero a 1 ano e 6 meses)","description":"Conhecer e manipular materiais impressos e audiovisuais em diferentes portadores (livro, revista, gibi, jornal, cartaz, CD, tablet etc.)."},{"code":"EI02EF07","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Manusear diferentes portadores textuais, demonstrando reconhecer seus usos sociais."},{"code":"EI03EF07","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Levantar hipóteses sobre gêneros textuais veiculados em portadores conhecidos, recorrendo a estratégias de observação gráfica e/ou de leitura."},{"code":"EI01EF08","range":"Bebês (zero a 1 ano e 6 meses)","description":"Participar de situações de escuta de textos em diferentes gêneros textuais (poemas, fábulas, contos, receitas, quadrinhos, anúncios etc.)."},{"code":"EI02EF08","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Manipular textos e participar de situações de escuta para ampliar seu contato com diferentes gêneros textuais parlendas, histórias de aventura, tirinhas, cartazes de sala, cardápios, notícias etc.)."},{"code":"EI03EF08","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Selecionar livros e textos de gêneros conhecidos para a leitura de um adulto e/ou para sua própria leitura partindo de seu repertório sobre esses textos, como a recuperação pela memória, pela leitura das ilustrações etc.)."},{"code":"EI01EF09","range":"Bebês (zero a 1 ano e 6 meses)","description":"Conhecer e manipular diferentes instrumentos e suportes de escrita."},{"code":"EI02EF09","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Manusear diferentes instrumentos e suportes de escrita para desenhar, traçar letras e outros sinais gráficos."},{"code":"EI03EF09","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Levantar hipóteses em relação à linguagem escrita, realizando registros de palavras e textos, por meio de escrita espontânea."}]},{"title":"ESPAÇOS, TEMPOS, QUANTIDADES, RELAÇÕES E TRANSFORMAÇÕES","itens":[{"code":"EI01ET01","range":"Bebês (zero a 1 ano e 6 meses)","description":"Explorar e descobrir as propriedades de objetos e materiais (odor, cor, sabor, temperatura)."},{"code":"EI02ET01","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Explorar e descrever semelhanças e diferenças entre as características e propriedades dos objetos textura, massa, tamanho)."},{"code":"EI03ET01","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Estabelecer relações de comparação entre objetos, observando suas propriedades."},{"code":"EI01ET02","range":"Bebês (zero a 1 ano e 6 meses)","description":"Explorar relações de causa e efeito transbordar, tingir, misturar, mover e remover etc.) na interação com o mundo físico."},{"code":"EI02ET02","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Observar, relatar e descrever incidentes do cotidiano e fenômenos naturais (luz solar, vento, chuva etc.)."},{"code":"EI03ET02","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Observar e descrever mudanças em diferentes materiais, resultantes de ações sobre eles, em experimentos envolvendo fenômenos naturais e artificiais."},{"code":"EI01ET03","range":"Bebês (zero a 1 ano e 6 meses)","description":"Explorar o ambiente pela ação e observação, manipulando, experimentando e fazendo descobertas."},{"code":"EI02ET03","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Compartilhar, com outras crianças, situações de cuidado de plantas e animais nos espaços da instituição e fora dela."},{"code":"EI03ET03","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Identificar e selecionar fontes de informações, para responder a questões sobre a natureza, seus fenômenos, sua conservação."},{"code":"EI01ET04","range":"Bebês (zero a 1 ano e 6 meses)","description":"Manipular, experimentar, arrumar e explorar o espaço por meio de experiências de deslocamentos de si e dos objetos."},{"code":"EI02ET04","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Identificar relações espaciais (dentro e fora, em cima, embaixo, acima, abaixo, entre e do lado) e temporais (antes, durante e depois)."},{"code":"EI03ET04","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Registrar observações, manipulações e medidas, usando múltiplas linguagens desenho, registro por números ou escrita espontânea), em diferentes suportes."},{"code":"EI01ET05","range":"Bebês (zero a 1 ano e 6 meses)","description":"Manipular materiais diversos e variados para comparar as diferenças e semelhanças entre eles."},{"code":"EI02ET05","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Classificar objetos, considerando determinado atributo (tamanho, peso, cor, forma etc.)."},{"code":"EI03ET05","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Classificar objetos e figuras de acordo com suas semelhanças e diferenças."},{"code":"EI01ET06","range":"Bebês (zero a 1 ano e 6 meses)","description":"Vivenciar diferentes ritmos, velocidades e fluxos nas interações e brincadeiras em danças, balanços, escorregadores etc.)."},{"code":"EI02ET06","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Utilizar conceitos básicos de tempo (agora, antes, durante, depois, ontem, hoje, amanhã, lento, rápido, depressa, devagar)."},{"code":"EI03ET06","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Relatar fatos importantes sobre seu nascimento e desenvolvimento, a história dos seus familiares e da sua comunidade."},{"code":"EI02ET07","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Contar oralmente objetos, pessoas, livros etc., em contextos diversos."},{"code":"EI03ET07","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Relacionar números às suas respectivas quantidades e identificar o antes, o depois e o entre em uma sequência."},{"code":"EI02ET08","range":"Crianças bem pequenas (1 ano e 7 meses a 3 anos e 11 meses)","description":"Registrar com números a quantidade de crianças meninas e meninos, presentes e ausentes) e a quantidade de objetos da mesma natureza bonecas, bolas, livros etc.)."},{"code":"EI03ET08","range":"Crianças pequenas (4 anos a 5 anos e 11 meses)","description":"Expressar medidas (peso, altura etc.), construindo gráficos básico"}]}];

